import React from "react";

function Footer() {
  return (
    <div className="footer">
      <footer class="py-3 fixed-bottom" style={{backgroundColor: '#576F72'}}>
        <div class="container" style={{fontFamily: 'Roboto'}}>
          <p class="m-0 text-center text-white">
            CSE412 - De Luca Fall 2022
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
